import React from "react";
import "./ExpenseItem.css";

const ExpenseItem = () => {
  return (
    <div>
      <div>
        <div>Do all exercises!</div>
      </div>

      <div>Finish the course!</div>
    </div>
  );
};

export default ExpenseItem;
